import React from 'react';

export default class Login extends React.Component{
  render() {
    return(
      <form>
        <h1>Login to your account:</h1>
        <label>Email: </label>
        <input name="email" placeholder="freddie.mercury@gmail.com" size="500px"/>
        <br />
        <label>Password: </label>
        <input name="password" placeholder="queen_rox"/>
      </form>
    )
  };
};
